package com.pranavaeet.config;

import java.io.FileInputStream;
import java.io.IOException;
import java.io.InputStream;
import java.nio.file.Paths;
import java.util.Properties;

import org.apache.logging.log4j.LogManager;
import org.apache.logging.log4j.Logger;


public class Variables {
	
	public Variables(){
		if(!loaded)init();
	}
	
	final static Logger logger = LogManager.getLogger();	
	static Properties prop = new Properties();
	static InputStream input = null;
	static boolean loaded = false;
	
	private static void init(){		 
		try{ 
			logger.info("Loading properties for server . . . ");
			//Do not change this path
			input = new FileInputStream("/etc/app-config/app-config.properties");			
			prop.load(input);	
			loaded = true;
		}catch(Exception e){			
			logger.error("Error while loading configuration file for server . . . ");
			logger.error(e.getMessage());
			try{ 
				logger.info("Loading properties for localhost . . . ");        
				input = new FileInputStream(Paths.get(Variables.class.getResource("/app-config.properties").toURI()).toString());  
				prop.load(input);
				loaded = true;
			}catch(Exception ex){
				ex.printStackTrace();
				logger.error("Error while loading configuration file for localhost . . . ");
				logger.error(ex.getMessage());
			}			
		}finally{
			try {
				input.close();
			} catch (IOException e) {				
				e.printStackTrace();
			}
		}
	}
	
	/************************************* 
	 * 	MySQL Configuration Parameters
	 *************************************/
	public static final String dbDriver				=  getDatabaseDriver();
	public static final String dbUrl 				=  getDatabaseUrl();
	public static final String dbUsername 			=  getDatabaseUsername();	
	public static final String dbPassword 			=  getDatabasePassword();
	public static final String defaultUserString 	=  getDefaultUserString();
	
	public static final String gcsClientId  		=  getGCSClientId();	
	public static final String gcsClientEmail		=  getGCSClientEmail();	
	public static final String gcsPrivateKey	    =  getGCSPrivateKey();	
	public static final String gcsPrivateKeyId		=  getGCSPrivateKeyId();	
	public static final String gcsProjectId			=  getGCSProjectId();
			
	private static String getDatabaseDriver(){		
		if(!loaded)init();
		return prop.getProperty("databaseDriver");
	}
	
	private static String getDatabaseUrl(){		
		if(!loaded)init();
		return prop.getProperty("databaseUrl");
	}
	
	private static String getDatabaseUsername(){		
		if(!loaded)init();
		return prop.getProperty("databaseUsername");
	}
	
	private static String getDatabasePassword(){		
		if(!loaded)init();
		return prop.getProperty("databasePassword");
	}
	
	private static String getDefaultUserString() {
		return new String("");
	}
	
	private static String getGCSClientId(){		
		if(!loaded)init();
		return prop.getProperty("storageClientId");
	}
	
	private static String getGCSClientEmail(){		
		if(!loaded)init();
		return prop.getProperty("storageClientEmail");
	}
	
	private static String getGCSPrivateKeyId(){		
		if(!loaded)init();
		return prop.getProperty("storagePrivateKeyId");
	}
	
	private static String getGCSPrivateKey(){		
		if(!loaded)init();
		return prop.getProperty("storagePrivateKey");
	}
	
	private static String getGCSProjectId(){
		if(!loaded)init();
		return prop.getProperty("storageProjectId");
	}
	
}
